// SPDX-License-Identifier: SimPL-2.0

pragma solidity ^0.7.0;

/**
 * @title The Three Kingdoms Helper
 *
 * @author Bit Lighthouse. Ace
 * AT: 2021-3-28 | VERSION: v1.0.2
 */
library Helper {
    uint8 constant public BIT_QUALITY = 63;
    uint8 constant public BIT_HEROID = 60;
    uint8 constant public BIT_AMOUNT = 44;
    uint8 constant public BIT_TIMESTAMP = 12;

    function random(uint256 _value) public view
        returns (uint256) {

        bytes32 h = keccak256(abi.encodePacked(
            block.timestamp, block.timestamp
        ));

        bytes memory seed = abi.encodePacked(h);
        uint256 result = uint256(keccak256(seed));

        result = result % _value;

        return result == 0 ? _value : result;
    }

    function generate(
        uint256 quality_, uint256 id_, uint256 amount_
    ) public view returns (uint64 tokenId) {
        // quality - id - amount - timestamp
        // 8 - 8 - 16 - 32

        tokenId = 1 << 63;

        tokenId = tokenId | uint64(uint8(quality_)) << BIT_QUALITY;
        tokenId = tokenId | uint64(uint8(id_)) << BIT_HEROID;
        tokenId = tokenId | uint64(uint16(amount_)) << BIT_AMOUNT;
        tokenId = tokenId | uint64(uint32(block.timestamp)) << BIT_TIMESTAMP;
    }

    function analysis(uint64 tokenId_) public pure
        returns (uint8, uint8, uint32) {

        uint8 quality = uint8(tokenId_ >> BIT_QUALITY);
        uint8 heroId = uint8(tokenId_ >> BIT_HEROID);
        uint32 timestamp = uint32(tokenId_ >> BIT_TIMESTAMP);

        return (quality, heroId, timestamp);
    }
}

